CREATE TABLE `registrants` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `registration_id` bigint(20) unsigned NOT NULL,
  `firstname` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `lastname` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `dob` bigint(20) NOT NULL DEFAULT '0',
  `address` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `city` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `state` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `zip` varchar(11) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `mobile` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `mobilecarrier` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `email` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `program` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `location` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `course` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `fee` double(8,2) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `event_id` bigint(20) NOT NULL DEFAULT '0',
  `event` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `ticket_id` bigint(20) NOT NULL DEFAULT '0',
  `ticket` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `indid` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '0',
  `map` smallint(6) NOT NULL DEFAULT '0',
  `das` smallint(6) NOT NULL DEFAULT '0',
  `schoolyear` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT '',
  PRIMARY KEY (`id`),
  KEY `registrants_registration_id_foreign` (`registration_id`)
) ENGINE=MyISAM AUTO_INCREMENT=2404 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
