INSERT INTO `settings` VALUES (1,NULL,'2025-04-27 14:50:04','traderegistration','Trade Registration','status',NULL,NULL,'true','boolean',0),(2,NULL,'2025-04-27 23:04:18','eventregistration','Event Registration','status',NULL,NULL,'true','boolean',0),(3,NULL,'2025-04-27 14:50:04','trademessage','Trade Message','status',NULL,NULL,'The trade class registration is closed for a quick update! Please check back at 4PM EST on 6/21/2022.\r\n\r\nThanks for your patience! Email allison@gwgci.org with any questions.','alpha_dash',0),(4,NULL,'2025-04-27 20:11:46','eventmessage','Event Message','status',NULL,NULL,'The event registration is currently closed.','alpha_dash',0),(5,NULL,'2025-07-01 21:19:43','ADMIN_EMAIL','Admin Email','general',NULL,NULL,'test@voxcomp.com','alpha_dash',0),(6,NULL,'2025-04-27 20:49:10','ADMIN_EMAIL2','Alternate Admin Email','general',NULL,NULL,'francisd@voxcomp.com','alpha_dash',0),(13,NULL,'2025-04-27 14:50:04','t_Pipefitter','Pipefitter','agreement',NULL,NULL,'I understand that I need an Apprentice License through the Division of Occupational Licensure (DOL) in addition to the Division of Apprentice Standards card.  &lt;a href=&quot;https://www.mass.gov/orgs/division-of-occupational-licensure&quot; target=&quot;_blank&quot;&gt;Learn More&lt;/a&gt;','text',0),(14,NULL,'2025-04-27 20:51:06','fp_correspondence','Correspondence','editor',NULL,NULL,'&lt;p&gt;Correspondence courses empower students to learn on their own time from anywhere with convenience and flexibility.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Choose your trades&lt;/li&gt;&lt;li&gt;We mail you the books&lt;/li&gt;&lt;li&gt;Study at your own pace&lt;/li&gt;&lt;li&gt;Take a test each month to earn credit hours&lt;/li&gt;&lt;/ul&gt;','text',0),(15,NULL,'2025-04-27 14:50:04','fp_online','Online','editor',NULL,NULL,'&lt;p&gt;&lt;i&gt;&lt;strong&gt;Powered by Penn Foster&lt;/strong&gt;&lt;/i&gt;&lt;br&gt;Online courses can be taken at your own pace. &amp;nbsp;Receive a certificate of completion when successfully finishing any course.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Basic Math&lt;/li&gt;&lt;li&gt;Blueprint Reading&lt;/li&gt;&lt;li&gt;Career Readiness Bootcamp&lt;/li&gt;&lt;li&gt;Business Literacy&lt;/li&gt;&lt;li&gt;Intro to Construction&lt;/li&gt;&lt;/ul&gt;','text',0),(16,NULL,'2025-04-29 16:49:39','fp_trade','Trade','editor',NULL,NULL,'&lt;p&gt;Trade classes generally run at night from September to April each year. Early Bird School Registration is open until July 1, 2022. To qualify, payment must be made in full by July 1, 2022, or the full price will be charged after that. Payment plans do not qualify for Early Bird Pricing.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Carpentry&lt;/li&gt;&lt;li&gt;HVAC&lt;/li&gt;&lt;li&gt;Electrical&lt;/li&gt;&lt;li&gt;Pipefitting&lt;/li&gt;&lt;li&gt;Plumbing&lt;/li&gt;&lt;li&gt;Sheet Metal &amp;amp; more!&amp;nbsp;&lt;/li&gt;&lt;/ul&gt;','text',0),(17,NULL,'2025-04-27 14:50:04','fp_training','Training','editor',NULL,NULL,'&lt;p&gt;Training classes are mostly held in-person, and generally fall under one of the following categories:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Continuing Education&lt;/li&gt;&lt;li&gt;License Preparation&lt;/li&gt;&lt;li&gt;Professional Development&lt;/li&gt;&lt;li&gt;Safety&lt;/li&gt;&lt;li&gt;Events&lt;/li&gt;&lt;/ul&gt;','text',0),(18,NULL,'2025-04-27 14:50:04','onlineregistration','Online Registration','status',NULL,NULL,'true','boolean',0),(19,NULL,'2025-04-27 14:50:04','onlinemessage','Online Registration Message','status',NULL,NULL,'The class registration is currently closed.','alpha_dash',0),(9,NULL,'2025-04-27 14:50:04','api_login','Authorize.net API Login','api',NULL,NULL,'eyJpdiI6IjRDeTgyT0JkOVpxSUp1UG5lK1A3eWc9PSIsInZhbHVlIjoiN1ZGWXRXRDR4VWN6TlN6QTFTTnd6K2taekhJbm1EUFdRcTE0cWVDd1NtOD0iLCJtYWMiOiI1MGIzNDNkNGJlYzVlOGY2MGNlYmQ2ZWVkNmIxZTQ0Y2FkMzdjNjk4ZDU0OTZkYjg2YjFjOTRjZmQ3YmM2NWMxIn0=','alpha_dash',1),(10,NULL,'2025-04-27 14:50:04','transaction_key','Authorize.net Transaction Key','api',NULL,NULL,'eyJpdiI6IkNRV2lzWEI3d