 pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.&lt;/p&gt;','text',0),(44,'2025-06-25 21:09:31','2025-06-25 21:10:50','hd_billing','Billing Help','editor','','','&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.&lt;/p&gt;','text',0),(22,NULL,'2025-04-27 20:12:13','paymentAgree','Payment Agreement','editor',NULL,NULL,'&lt;p&gt;&lt;span style=&quot;color:rgb(0,0,0);&quot;&gt;Due to limited seats in each class, full tuition payment must be received by August 23, 2024, to confirm your registration. Please plan accordingly so that you are prepared to make this payment and can start the school year with no last-minute surprises. By clicking &quot;submit&quot; below and completing the registration process, you are confirming that you agree to the above terms per your registration.&lt;/span&gt;&lt;/p&gt;','text',0),(23,NULL,'2025-04-27 14:50:04','fund_goal','Funding Goal','donation',NULL,NULL,'500000','numeric',0),(33,NULL,'2025-04-27 20:47:20','payment_limit','Payment Limit','donation',NULL,NULL,'5000','numeric',0),(34,NULL,'2025-04-27 23:00:06','tradeconfirmation','Trade Confirmation','editor',NULL,NULL,'&lt;p&gt;Thank you for registering for this class. This is only &lt;span style=&quot;color:hsl(0,75%,60%);&quot;&gt;&lt;strong&gt;Step 1&lt;/strong&gt;&lt;/span&gt; of the registration process. Please complete the steps listed below to complete the registration process for the 2024-2025 GCI School Year:&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Please note:&lt;/strong&gt; If you registered between June 17, 2024 and July 1, 2024, payment must be received in full by July 1, 2024 to be eligible for the Early Bird Registration discount. If payment is not received in full by July 1, 2024, you will receive a new invoice with the additional $175 per student added to your total.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Important:&lt;/strong&gt; Due to limited seats in each class, full tuition payment must be received by August 23, 2024, to confirm your registration. Please plan accordingly so that you are prepared to make this payment and can start the school year with no last-minute surprises. By clicking &ldquo;submit&rdquo; at the beginning of the registration process, you are confirming that you agree to the above terms per your registration.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color:hsl(0,75%,60%);&quot;&gt;&lt;strong&gt;Step 2&lt;/strong&gt;&lt;/span&gt;&lt;strong&gt;:&lt;/strong&gt; Create an account in the document management system. This is where you will find all necessary paperwork for your time with GCI. (This will be explained further at your orientation.)&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Existing students:&lt;/strong&gt; If you already created an account last year, you do not need to do anything else. If you have not created an account yet, please complete the steps below for &quot;New students.&quot;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;New students:&lt;/strong&gt; &lt;a href=&quot;https://gwgci.diamondadm.com/self-service&quot;&gt;https://gwgci.diamondadm.com/self-service&lt;/a&gt; (After you complete this form, you will receive an email with your login information.)&lt;/p&gt;&lt;p style=&quot;text-align:center;&quot;&gt;&lt;strong&gt;Please contact the GCI Office with any questions!&lt;/strong&gt;&lt;/p&gt;','text',0),(35,NULL,'2025-04-27 22:11:58','correspondenceconfirmation','Correspondence Confirmation','editor',NULL,NULL,'&lt;h4&gt;ASME Correspondence Registrants Only:&lt;/h4&gt;&lt;p&gt;Please note: &lt;strong&gt;Length of Experience (Prerequisite = 6+ yrs. field experience)&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Applicants that are seeking a Pipefitter License must apply for an apprenticeship license with the Division of Professional Licensure, Office of Public Safety and Inspections in addition to registering as an apprentice with Division of Apprentice Standards (DAS).&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.mass.gov/files/documents/2018/09/07/appl-eng-pipefitter-apprentice-aug2018.pdf&quot;&gt;https://www.mass.gov/files/documents/2018/09/07/appl-eng-pipefitter-apprentice-aug2018.pdf&lt;/a&gt;&lt;/p&gt;&lt;p&gt;ASME Manuals available by contacting:&lt;/p&gt;&lt;p&gt;(You may use either of the following methods):&lt;/p&gt;&lt;p&gt;Phone: (800) 843-2763 Fax: (973) 882-1717 Web Site: &lt;a href=&quot;https://www.asme.org/catalog&quot;&gt;www.asme.org/catalog&lt;/a&gt;&lt;/p&gt;&lt;p&gt;The book that you will need to obtain is:&lt;/p&gt;&lt;p&gt;&lt;i&gt;&lt;strong&gt;ASME Power Piping B31.1-2018&lt;/strong&gt;&lt;/i&gt;&lt;br&gt;&lt;strong&gt;Item # A05818&lt;/strong&gt;&lt;br&gt;&lt;strong&gt;Price: $335.00 plus shipping &amp;amp; handling&lt;/strong&gt;&lt;/p&gt;&lt;h4&gt;All Other Correspondence Registrants:&lt;/h4&gt;&lt;p&gt;First time students need to take a couple of steps before testing can begin. Correspondence testing is now conducted completely online.&lt;/p&gt;&lt;ol&gt;&lt;li&gt;First Time Students: Register through NCCER &lt;a href=&quot;https://www.nccer.org/&quot;&gt;https://www.nccer.org/&lt;/a&gt;&lt;ol&gt;&lt;li&gt;Click &quot;Sign In&quot; and then &quot;CREATE A NEW ACCOUNT&quot;&lt;/li&gt;&lt;li&gt;Once complete, the student will receive an NCCER ID number. Write this down somewhere it can easily be accessed. Students will only need to create an account once. &lt;strong&gt;&lt;u&gt;This step MUST be completed before signing up for monthly testing.&lt;/u&gt;&lt;/strong&gt;&lt;/li&gt;&lt;li&gt;Students will need to register for testing with their NCCER number EVERY MONTH. Any registrations that do not include an NCCER ID may be pushed to the next month if all accurate information is not provided promptly.&lt;/li&gt;&lt;/ol&gt;&lt;/li&gt;&lt;li&gt;Students will need to register for testing online through our site every month: &lt;a href=&quot;https://www.gwgci.org/education/correspondence-courses-2/&quot;&gt;https://www.gwgci.org/education/correspondence-courses-2/&lt;/a&gt;&lt;ol&gt;&lt;li&gt;Students will need their NCCER ID number and the full Module Number of the test being taken (example 00101-15) in order to successfully register for tests each month.&lt;/li&gt;&lt;/ol&gt;&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;strong&gt;Please contact Keyla Rodriguez-Santiago (keyla@gwgci.org) with any questions about Correspondence testing.&lt;/strong&gt;&lt;/p&gt;','text',0),(36,NULL,'2025-04-27 23:03:47','eventconfirmation','Event Confirmation','editor',NULL,NULL,'&lt;p&gt;Thank you for your registration. Someone from the Gould Construction Institute staff will reach out with more information if your registration requires a follow up. Please note that refunds or cancellations will not be allowed one week prior to the event.&lt;/p&gt;&lt;p&gt;For any questions, please contact Diane Craven: &lt;a href=&quot;https://regstaging.gwgci.org/diane@gwgci.org&quot;&gt;diane@gwgci.org&lt;/a&gt;&lt;/p&gt;','text',0),(37,NULL,'2025-04-27 23:00:06','onlineconfirmation','Online Confirrmation','editor',NULL,NULL,'&lt;p&gt;Thank you for your registration. You will receive an email from Penn Foster with login information for your desired course within 2 business days. If you do not receive your login information within 2 business days of registration, please contact Allison Jackson: &lt;a href=&quot;mailto:allison@gwgci.org&quot;&gt;allison@gwgci.org&lt;/a&gt;&lt;/p&gt;&lt;p&gt;Check out the rest of what GCI has coming up on our training calendar: &lt;a href=&quot;https://www.gwgci.org/events/&quot;&gt;https://www.gwgci.org/events/&lt;/a&gt;&lt;/p&gt;','text',0),(38,NULL,NULL,'fp_event','Events','editor',NULL,NULL,'Upcoming events','text',0),(39,NULL,'2025-06-23 23:21:19','trainingconfirmation','Training Confirmation','editor',NULL,NULL,'&lt;p&gt;Thank you for your registration. Someone from the Gould Construction Institute staff will reach out with more information if your registration requires a follow up. Please note that refunds or cancellations will not be allowed one week prior to the class start date.&lt;/p&gt;&lt;p&gt;For any questions, please contact Diane Craven: &lt;a href=&quot;https://regstaging.gwgci.org/diane@gwgci.org&quot;&gt;diane@gwgci.org&lt;/a&gt;&lt;/p&gt;&lt;p&gt;Check out the rest of what GCI has coming up on our training calendar: &lt;a href=&quot;https://www.gwgci.org/events/&quot;&gt;https://www.gwgci.org/events/&lt;/a&gt;&lt;/p&gt;&lt;p&gt;Did you know Gould Construction Institute has an entire Virtual Suite of On-Demand Courses? Some available courses even qualify for college credits!&lt;/p&gt;&lt;p&gt;Check out them out here: &lt;a href=&quot;https://www.gwgci.org/education/online-program-overview-2/&quot;&gt;https://www.gwgci.org/education/online-program-overview-2/&lt;/a&gt;&lt;/p&gt;','text',0),(40,NULL,NULL,'trainingregistration','Training Registration','status',NULL,NULL,'true','boolean',0),(41,NULL,NULL,'trainingmessage','Training Message','status',NULL,NULL,'The training registration is currently closed.','alpha_dash',0),(45,'2025-06-25 21:09:31','2025-06-25 21:10:50','hd_payment','Payment Help','editor','','','&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.&lt;/p&gt;','text',0),(46,'2025-06-25 21:09:31','2025-06-25 21:10:50','hd_individual','Individual Help','editor','','','&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.&lt;/p&gt;','text',0);
